import Human from 'https://cdn.jsdelivr.net/npm/@vladmandic/human@3.0.5/+esm'

const humanConfig = {
  debug: false,
  modelBasePath: 'https://vladmandic.github.io/human-models/models/',
  filter: { enabled: true, equalization: false, flip: true },
  face: {
    enabled: true,
    detector: { enabled: false },
    iris: { enabled: false },
    description: { enabled: false },
    emotion: { enabled: true },
    antispoof: { enabled: false },
    liveness: { enabled: false }
  },
  body: { enabled: false },
  hand: { enabled: false },
  object: { enabled: false },
  gesture: { enabled: false },
  segmentation: { enabled: false },
}

async function useGame(serie=['angry', 'happy']) {
  let emotion = serie[randint(0,serie.length)]
  environment.emotion = [emotion, null]
  await environment.wait()
  function next(userEmotion) {
    return match(userEmotion)
          .with(emotion, _ => {
            emotion = serie[randint(0,serie.length)]
            environment.emotion = [emotion,null]
            return environment.wait()
          })
          .otherwise(_ => {
            environment.emotion = [emotion, userEmotion]
            return environment.wait()
          })
  }
  return next
}


const next = await useGame()

const human = new Human(humanConfig)
captureStream().pipe(
  throttleTime(1000),
  concatMap(x => human.detect(x.message)),
  filter(x => x.face && x.face.length > 0),
  map(x => x.face[0].emotion[0].emotion),
  concatMap(emotion => next(emotion))
)

